const Payment = () => {
  return (
    <Container>
      <Header>
        <HeaderTitle>Payment</HeaderTitle>
        <HeaderSubtitle>3 payment method available</HeaderSubtitle>
      </Header>
      <PaymentMethod>
        <PeymentMethodTitle>Payment Method</PeymentMethodTitle>
        <Cards>
          <Card></Card>
        </Cards>
      </PaymentMethod>
    </Container>
  )
}

export default Payment;
